INSERT INTO `recept_text` (`id`, `text`, `numeration`, `id_article`) VALUES
(2, '1. Разогреть духовку. Отделить белки от желтков. Белки взбить в крепкую пену с щепоткой соли, постепенно добавляя сахар.', 1, 164),
(3, '2. Продолжать взбивать, добавляя по одному желтки, затем разрыхлитель и муку. Тесто по консистенции должно напоминать сметану.', 2, 164),
(4, '3. Смазать противень растительным маслом. Вылить половину теста на противень, разложить равномерно нарезанные дольками яблоки, залить второй половиной теста.', 3, 164),
(5, '4. Поместить противень в разогретую духовку. 3 минуты подержать при температуре 200 градусов, затем убавить до 180 и выпекать 20-25 минут.', 4, 164);

